import React, { Component } from "react";
import NavBar from "./NavBar";

export default class Profile extends Component{ 
    state = {
        about: true,
    }


    render() {
        console.log(this.props.loginUser)
        const phone =  `(${this.props.loginUser.phone.slice(0, 3)}) ${this.props.loginUser.phone.slice(3, 6)}-${this.props.loginUser.phone.slice(6, 10)}`
        return(
            <div>
                 {
                 Object.keys(this.props.loginUser).length > 0
                 ?<div>
                     <div className="profile-page-header"></div>
                    <NavBar loginUser={this.props.loginUser} handlehideMusic={this.props.handlehideMusic}/>
                    <div className="sub-nav">
                        <ul>
                            <li>About</li>
                            <li>Edit Profile</li>
                        </ul>
                    </div>

                    {this.state.about
                    ?<div className="about">
                        <li>Name { this.props.loginUser.name }</li>
                        <li>Phone { phone }</li>
                        <li>Name { this.props.loginUser.email }</li>
                    </div>
                    :<div className="edit">

                    </div>
                    }    
                 </div>
                 :this.props.history.push('/')
                }
            </div>
        )
    }
}
